print "${jira_status_prop}"

jira_status = "$[/myJob/getIssuesResult/issues/$[/myPipelineRuntime/issueKey]/status]"
def is_trans = "true";
print "is_trans : ${is_trans}\n"
if ("${is_trans}" == "true"){
    print "is_trans : ${is_trans}\n"

	if("$[/myStageRuntime/outcome]" != "error" ){
       ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_success", 
               value: "true") 
    }else{
	  ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_success", 
               value: "true") 
      ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_fail", 
               value: "true") 
	 }
}

step.description:
import com.electriccloud.client.groovy.ElectricFlow
import com.electriccloud.client.groovy.models.*


ElectricFlow ef = new ElectricFlow()

def issueType = "$[JIRA_IssueType]"

def summary = "WEB Demo CD Pipeline"

def jira_status = false;
def jira_status_prop = "/myJob/getIssuesResult/issues/" + "$[/myPipelineRuntime/issueKey]"+"/status"
def jira_comment = "$[/myStageRuntime/stageName]: failed"

print "${jira_status_prop}"

jira_status = "$[/myJob/getIssuesResult/issues/$[/myPipelineRuntime/issueKey]/status]"



if ("$[/myJob/jira_issueKey]" == ""){
    ef.setProperty(propertyName:  "/myJob/jira_trans_cd_create", 
               value: "true")
}else{
  def is_trans = "true";
  if("$[/myTaskRuntime/runNumber]" == ""){
    if("$[/myStageRuntime/stageName]" != "Audit Report"){
      if ( "${jira_status}" == "Backlog" || "${jira_status}" == "Done" || "${jira_status}" == "FAILED" || "${jira_status}" == "완료됨" ){
        ef.setProperty(propertyName:  "/myJob/jira_trans_reopen", 
               value: "true") 
      }else if(("$[/myStageRuntime/stageName]" == "${jira_status}") || ("$[/myStageRuntime/stageName]" == "QA" && "${jira_status}" == "PRODUCTION")){
		ef.setProperty(propertyName:  "/myJob/jira_trans_reopen", 
               value: "true") 
		ef.setProperty(propertyName:  "/myJob/jira_trans_Failed", 
               value: "true") 
      }
    }
	else{
	  if ( "${jira_status}" != "Production"){ 
	     is_trans = "false"
	  }
	}

	print "is_trans : ${is_trans}\n"
	if ("${is_trans}" == "true"){
	  print "is_trans : ${is_trans}\n"

	    if("$[/myStageRuntime/outcome]" != "error" ){
          ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_success", 
               value: "true") 
        }else{
		  ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_success", 
               value: "true") 
          ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_fail", 
               value: "true") 
	    }

	}
  }
}

if( "$[/myJob/RollingOutcome]" == "success" && "$[/myJob/UpdateAppResult]" == "success" && "$[/myStageRuntime/outcome]" != "error"){
   ef.setProperty(propertyName : "/myPipelineRuntime/IsAudit",
                      value : "true")
}

step.command:
import com.electriccloud.client.groovy.ElectricFlow
import com.electriccloud.client.groovy.models.*


ElectricFlow ef = new ElectricFlow()

def issueType = "$[JIRA_IssueType]"

def summary = "WEB Demo CD Pipeline"

def jira_status = false;
def jira_status_prop = "/myJob/getIssuesResult/issues/" + "$[/myPipelineRuntime/issueKey]"+"/status"
def jira_comment = "$[/myStageRuntime/stageName]: failed"

println "${jira_status_prop}"

jira_status = "$[/myJob/getIssuesResult/issues/$[/myPipelineRuntime/issueKey]/status]"





if ("$[/myJob/jira_issueKey]" == ""){
    ef.setProperty(propertyName:  "/myJob/jira_trans_cd_create", 
               value: "true")
}else{
  def is_trans = "true";
  def jiraStatusList = []
  jiraStatusList.addAll(["Backlog","Done","FAILED","완료됨"])

  def status = jiraStatusList.contains("${jira_status}")

  println "${status}"
  if("$[/myTaskRuntime/runNumber]" == ""){
    if("$[/myStageRuntime/stageName]" != "Audit Report"){
      if ( "${jira_status}" == "Backlog" || "${jira_status}" == "Done" || "${jira_status}" == "FAILED" || "${jira_status}" == "완료됨" ){
        ef.setProperty(propertyName:  "/myJob/jira_trans_reopen", 
               value: "true") 
      }else if(("$[/myStageRuntime/stageName]" == "${jira_status}") || ("$[/myStageRuntime/stageName]" == "QA" && "${jira_status}" == "PRODUCTION")){
		ef.setProperty(propertyName:  "/myJob/jira_trans_reopen", 
               value: "true") 
		ef.setProperty(propertyName:  "/myJob/jira_trans_Failed", 
               value: "true") 
      }
    }
	else{
	  if ( "${jira_status}" != "Production"){ 
	     is_trans = "false"
	  }
	}

	print "is_trans : ${is_trans}\n"
	if ("${is_trans}" == "true"){
	  print "is_trans : ${is_trans}\n"

	    if("$[/myStageRuntime/outcome]" != "error" ){
          ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_success", 
               value: "true") 
        }else{
		  ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_success", 
               value: "true") 
          ef.setProperty(propertyName:  "/myJob/jira_issueKey_trans_fail", 
               value: "true") 
	    }

	}
  }
}

if( "$[/myJob/RollingOutcome]" == "success" && "$[/myJob/UpdateAppResult]" == "success" && "$[/myStageRuntime/outcome]" != "error"){
   ef.setProperty(propertyName : "/myPipelineRuntime/IsAudit",
                      value : "true")
}
